import { TextProps } from "components/Text/types";
import {
	TextHeading1,
	TextHeading2,
	TextHeading3,
	TextHeading4,
	TextHeading5,
	TextParagraph1,
	TextParagraph2,
	TextDescription1,
	TextDescription2,
	TextParagraph3,
} from "./TextStyles";

const Text = ({ variant, children }: TextProps) => {
	switch (variant) {
		case "h1":
			return <TextHeading1>{children}</TextHeading1>;
		case "h2":
			return <TextHeading2>{children}</TextHeading2>;

		case "h3":
			return <TextHeading3>{children}</TextHeading3>;
		case "h4":
			return <TextHeading4>{children}</TextHeading4>;
		case "p":
			return <TextP>{children}</TextP>;
		case "description":
			return <TextD>{children}</TextD>;
	}
};

export default Text;
